    function dfs(s, i, t) {
        if (i == n) {
            ans.push(t.slice());
            return;
        }
        for (var j = i; j < n; j++) {
            if (dp[i][j]) {
                t.push(s.substring(i, j + 1));
                dfs(s, j + 1, t);
                t.pop();
            }
        }
    }
    dfs(s, 0, []);
    return ans;
